
<!DOCTYPE html>
<html>
<head>
    <title>Cadirrrr</title>
    <meta name="viewport" content="width=device-width, initial-scale=1, user-scalable=no">
    <style>
        * {
            padding: 0;
            margin: 0;
        }
    body {
        overflow: hidden;
        display: flex;
        justify-content: center;
        align-items: center;
        height: 100vh;
    }

    #gameCanvas {
        width: 100%; 
        height: 100%; 
        border: 2px solid black;
    }
    #game-over {
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  background-color: rgba(0, 0, 0, 0.7);
  color: white;
  padding: 20px;
  text-align: center;
  border-radius: 10px;
}

#game-over p {
  margin: 10px 0;
  font-size: 24px;
}

#score-display {
  font-size: 18px;
}

#restart-button {
  background-color: #4CAF50;
  color: white;
  padding: 10px 20px;
  border: none;
  border-radius: 5px;
  cursor: pointer;
  font-size: 18px;
}

#restart-button:hover {
  background-color: #45a049;
}

.hidden {
  display: none;
}

    </style>

    <canvas id="gameCanvas"></canvas>
    <div id="game-over" class="hidden">
        <p>Game Over!</p>
        <p id="score-display">Score: 0</p>
        <button id="restart-button">Neustart</button>
    </div>
    <script>
        const canvas = document.getElementById("gameCanvas");
        const ctx = canvas.getContext("2d");
        canvas.height = 640;
        canvas.width = 360;
        var img = document.getElementById("big");
        var cadirr = document.getElementById("cd");
        let gameOverChecker = false;
        let score = 0;
        let difficulty = Math.sqrt(score + 20) / 1.5;

        img.onload = function() {
            ctx.drawImage(img, 0, 0, 100, 100);
        }
        cadirr.onload = function() {
            ctx.drawImage(cadirr, 0, 0, 100, 100);

        }

        const bird = {
            x: 50,
            y: canvas.height / 2,
            radius: 20,
            velocity: 0,
            gravity: 0.5,
            jump: -10,
        };

        const pipe = {
            x: canvas.width,
            width: 50,
            gap: 200,
            minHeight: 50,
            maxHeight: canvas.height - 200,
        };


        function drawBird() {
            ctx.drawImage(cadirr, -100, -100, canvas.width +170, canvas.height + 250);
            ctx.drawImage(img, bird.x - bird.radius-2, bird.y - bird.radius-2, 44, 44);
        }

        function drawPipe() {
            for (let i = pipe.y - pipe.width; i > -pipe.width; i -= pipe.width - 10) {
                const centerX = pipe.width / 2;
                const centerY = pipe.width / 2;

                const rotationAngle = i * Math.PI / 13;

                ctx.translate(pipe.x + centerX, i + centerY);
                ctx.rotate(rotationAngle);
                ctx.drawImage(cadirr, -centerX, -centerY, pipe.width, pipe.width);

                ctx.rotate(-rotationAngle);
                ctx.translate(-(pipe.x + centerX), -(i + centerY));
            }
            ctx.drawImage(cadirr, pipe.x, pipe.y + pipe.gap + 5, pipe.width + 5, canvas.height - (pipe.y + pipe.gap));
        }

        function drawScore() {
            ctx.fillStyle = "white";
            ctx.font = "30px Arial";
            ctx.fillText("Score: " + score, 10, 30);
        }

        function update() {
            if (!gameOverChecker) {
                bird.velocity += bird.gravity;
                bird.y += bird.velocity;
    
                if (bird.y > canvas.height - bird.radius) {
                    bird.y = canvas.height - bird.radius;
                    bird.velocity = 0;
                }
    
                if (bird.y < bird.radius) {
                    bird.y = bird.radius;
                    bird.velocity = 0;
                }
    
                pipe.x -= difficulty;
                if (pipe.x + pipe.width < 0) {
                    pipe.x = canvas.width;
                    pipe.y = Math.floor(Math.random() * (pipe.maxHeight - pipe.minHeight + 1)) + pipe.minHeight;
                    score++;
                    difficulty = Math.sqrt(score + 20) / 1.5;
                }
    
                if (
                    bird.x + bird.radius > pipe.x &&
                    bird.x - bird.radius < pipe.x + pipe.width &&
                    (bird.y - bird.radius < pipe.y || bird.y + bird.radius > pipe.y + pipe.gap)
                ) {
                    gameOver();
                }
            }


            requestAnimationFrame(update);
            ctx.clearRect(0, 0, canvas.width, canvas.height);
            drawBird();
            drawPipe();
            drawScore();
        }

        function gameOver() {
            gameOverChecker = true;
    const gameOverDiv = document.getElementById("game-over");
    const scoreDisplay = document.getElementById("score-display");
    const restartButton = document.getElementById("restart-button");

    scoreDisplay.textContent = `Score: ${score}`;
    gameOverDiv.classList.remove("hidden");

    restartButton.addEventListener("click", function () {
        gameOverDiv.classList.add("hidden");
        // Hier sollte der Neustart-Code stehen
        document.location.reload();
    });
        }

        document.addEventListener("keydown", (event) => {
            if (event.code === "Space") {
                bird.velocity = bird.jump;
            }
        });

        document.addEventListener("touchstart", (event) => {
            bird.velocity = bird.jump;
        });
        update();
    </script>
</body>
</html>
